import Popup from "reactjs-popup";

class Event extends Component{
  constructor(props){
    super(props)
    this.state={
      name:"",
      desc:""
    }
  }
  event=()=>{
    console.log();
  }
  render(){
    return(
      <Popup style={{width:"auto"}} trigger={<button>Create an Event</button>} position="right top">
    <form onSubmit={this.event}>
        Event name:
        <input type="text" value={this.state.value} onChange={this.handleChange} required/>
        Event Desc:
        <input type="text" required/>
        From
        <input type="date"/>
        <input type="time"/>
        To
        <input type="date"/>
        <input type="time"/>
        <input type="submit"/>

    </form>
  </Popup>
    )
  }
}

export default Event;
